script: |
  super -f text -I q4234.spq | sort > q4234.out

inputs:
  - name: q4234.spq
    data: |
      SELECT col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 * col0 * col1 IN ( cor0.col0 ) OR + col1 * col1 - col1 / + col1 NOT BETWEEN col0 AND NULL;
  - name: tab2

outputs:
  - name: q4234.out
    data: |
